import React from 'react';

function Header(){
    return(
        <header> 
            <div> Ahmed Alamin </div>
            <ul>
                <li> Home </li>
                <li> About Me </li>
                <li> Portfolio </li>
                <li> Contact Me</li>
            </ul>
        </header>
    );
} 

export default Header;
